import { Navbar, Container, Nav, Card, Button } from 'react-bootstrap';
import React, { useState} from 'react'
import axios from 'axios';
import './App.css';
import './main.css';



function App() {

	var [top10, top10_change] = useState([]);

	axios.get('https://kobis.or.kr/kobisopenapi/webservice/rest/boxoffice/searchDailyBoxOfficeList.json', {
        params : {
            key : '36fcb6727085802f6401dc96e6743cf4',
            targetDt : 20211002,
        },
        // headers : headers,
    }).then(resonse => {
        var json = resonse.data.boxOfficeResult.dailyBoxOfficeList


        console.log(resonse.data.boxOfficeResult.dailyBoxOfficeList);
    }).catch( error => {
        console.log(error);
    })



	return (
		<div className="App">
			<Navbar bg="dark" variant="dark">
				<Container className='text-center'>
					<Navbar.Brand href="#home">MOVIEDIC</Navbar.Brand>
						<Nav className="me-auto">
						<Nav.Link href="#home">HOME</Nav.Link>
						<Nav.Link href="#features">BOXOFFICE</Nav.Link>
						<Nav.Link href="#pricing">HISTORY</Nav.Link>
						<Nav.Link href="#pricing">MY</Nav.Link>
					</Nav>
				</Container>
			</Navbar>

			<div className="container mt-4">
				<h4 className="text-center">List</h4>
					<div className="boxoffice10">
					{
						top10.map((movie, i) => {
							return (
								<Card style={{ width: '18rem' }}>
									<Card.Img variant="top" src="holder.js/100px180" />
									<Card.Body>
										<Card.Title>Card Title</Card.Title>
										<Card.Text>
										Some quick example text to build on the card title and make up the bulk of
										the card's content.
										</Card.Text>
										<Button variant="primary">Go somewhere</Button>
									</Card.Body>
								</Card>
							)
						})
					}
					</div>
			</div>
		</div>
	);
}

export default App;
